// Lookup by MUSIC_ID (binary search, array is sorted)
inline const EZ2ONSongEntry* ez2onFindByMusicId(int musicId) {
    int lo = 0, hi = EZ2ON_SONG_COUNT - 1;
    while (lo <= hi) {
        int mid = (lo + hi) / 2;
        if (EZ2ON_SONGS[mid].musicId == musicId) return &EZ2ON_SONGS[mid];
        if (EZ2ON_SONGS[mid].musicId < musicId) lo = mid + 1;
        else hi = mid - 1;
    }
    return nullptr;
}

// Lookup by title (case-insensitive substring match)
inline const EZ2ONSongEntry* ez2onFindByTitle(const char* query) {
    // Try exact match first (case-insensitive)
    for (int i = 0; i < EZ2ON_SONG_COUNT; i++) {
#ifdef _WIN32
        if (_stricmp(EZ2ON_SONGS[i].title, query) == 0) return &EZ2ON_SONGS[i];
#else
        if (strcasecmp(EZ2ON_SONGS[i].title, query) == 0) return &EZ2ON_SONGS[i];
#endif
    }
    return nullptr;
}

// Get difficulty slot index for a given key count and difficulty
inline int ez2onDiffSlot(int keyCount, int diff) {
    int modeBase = 0;
    switch (keyCount) {
        case 4: modeBase = EZ2ON_4K; break;
        case 5: modeBase = EZ2ON_5K; break;
        case 6: modeBase = EZ2ON_6K; break;
        case 8: modeBase = EZ2ON_8K; break;
        default: return -1;
    }
    if (diff < 0 || diff > 3) return -1;
    return modeBase + diff;
}

// Helper: case-insensitive string compare (portable)
inline bool ez2onStrEqualCI(const char* a, const char* b) {
#ifdef _WIN32
    return _stricmp(a, b) == 0;
#else
    return strcasecmp(a, b) == 0;
#endif
}

// Helper: lowercase a std::string in-place
inline void ez2onToLower(std::string& s) {
    for (auto& c : s) c = (char)tolower((unsigned char)c);
}

// Lookup by folder name (multi-pass: exact, prefix-stripped, substring)
// Handles DB titles like "O2_Endoffight", "AE_Halcyon", "Kamui", "SuddenDeath"
inline const EZ2ONSongEntry* ez2onFindByFolderName(const std::string& folderName) {
    std::string folder = folderName;
    ez2onToLower(folder);
    if (folder.empty()) return nullptr;

    // Known prefixes in EZ2ON internal title codes
    static const char* prefixes[] = {
        "o2_", "nw_", "ft_", "ec_", "tc_", "ae_", "nt_"
    };

    // Pass 1: exact match on title (case-insensitive)
    for (int i = 0; i < EZ2ON_SONG_COUNT; i++) {
        std::string t = EZ2ON_SONGS[i].title;
        ez2onToLower(t);
        if (t == folder) return &EZ2ON_SONGS[i];
    }

    // Pass 2: strip known prefix from title, then exact match
    for (int i = 0; i < EZ2ON_SONG_COUNT; i++) {
        std::string t = EZ2ON_SONGS[i].title;
        ez2onToLower(t);
        for (const char* prefix : prefixes) {
            size_t plen = strlen(prefix);
            if (t.length() > plen && t.substr(0, plen) == prefix) {
                t = t.substr(plen);
                break;
            }
        }
        if (t == folder) return &EZ2ON_SONGS[i];
    }

    // Pass 3: folder contains stripped title (for cases like "halcyontest" containing "halcyon")
    for (int i = 0; i < EZ2ON_SONG_COUNT; i++) {
        std::string t = EZ2ON_SONGS[i].title;
        ez2onToLower(t);
        for (const char* prefix : prefixes) {
            size_t plen = strlen(prefix);
            if (t.length() > plen && t.substr(0, plen) == prefix) {
                t = t.substr(plen);
                break;
            }
        }
        if (t.length() >= 3 && folder.find(t) != std::string::npos)
            return &EZ2ON_SONGS[i];
    }

    return nullptr;
}

// Match difficulty index (0=EZ,1=NM,2=HD,3=SHD) by note count within a known song
// Returns -1 if no match found
inline int ez2onMatchDifficulty(const EZ2ONSongEntry* song, int keyCount, int noteCount) {
    if (!song) return -1;
    int base = ez2onDiffSlot(keyCount, 0);
    if (base < 0) return -1;
    for (int d = 0; d < 4; d++) {
        if (song->noteCounts[base + d] == (uint16_t)noteCount)
            return d;
    }
    return -1;
}

